import Home from "../component/home";
import News from "../component/news";
import User from "../component/user";
import Not404 from "../component/not404";

const routers = [
    {
        exact:true,
        path:'/home',
        component:Home
    },
    {
        path:'/news',
        component:News,

    },
    {
        path:'/user',
        component:User
    },
    {
        component:Not404
    }
];
export default routes;
